import React from 'react'

export default function ProductsMainView() {
    return (
        <div className='h-100 w-100 overflow-auto'>
            <div className='row'>
                <div className='mb-5'>
                    <h3 className='mb-0'>Usuarios</h3>
                    <hr className='my-0' />
                </div>
            </div>
        </div>
    )
}
